Өмүрбаяны
 1953-жылы 17-августа Кыргыз Республикасынын Чүй облусунун Аламүдүн районундагы Кара-Жыгач   айылында тѳрѳлгѳн.
Жогорку билимдүү. 1976-жылы Кыргыз мамлекеттик университетинин филология факультетин,    1988-жылы Москва шаарындагы СССРдин Ички иштер министрлигинин Академиясын бүтүргөн;
 
Эмгек жолун 1970-жылы Фрунзе шаарындагы Ленин атындагы заводдун токарлыгынан баштаган;
1971-1976-жылдары Кыргыз мамлекеттик университетинин студенти;
1976–1978-жылдары – Фрунзедеги Советтик соода техникумунун комсомол
комитетинин катчысы;
1978-1982-жылдары Кыргызстан ЛКЖС БКнин  уюштуруу бѳлүмүнүн инструктору, бѳлүмдүн жетекчисинин орун басары;
1982–1983-жылдары – Кыргызстан комсомолунун Ысык-Көл облустук комитетинин катчысы;
1983-1986-жылдары – Ысык-Көл облустук аткаруу комитетинин Ички  иштер башкармасынын Саясий бөлүмүнүн башчысы;
1986-1988-жылдары  Москва шаарында СССРдин Ички иштер министрлигинин Академиясынын  күндүзгү бөлүмүндө окуган;
1989-1990 - жылдары Ысык-Көл облустук Ички иштер башкармасынын башчысынын орун басары;
1990-жылы Кыргыз  Республикасынын  Жогорку Советинин депутаттыгына шайланып, парламенттин туруктуу комиссиясынын төрагасынын орун басары болгон;
1991-жылдын ноябрь айынан тартып 1994-жылдын ноябрь айына чейин – Ысык-Көл облусунун Ички иштер башкармасынын башчысы;
1994-жылдын ноябрынан 1997-жылдын мартына чейин Кыргыз Республикасынын Ички иштер министринин орун басары;
1997-жылдын март айынан  2001-жылдын январь айына чейин – Кыргыз Республикасынын Ички иштер министринин  биринчи орун басары болуп иштеген;
2001-жылдын февралында Кыргыз Республикасынын Коопсуздук кеңешинин катчысынын орун басары жана Кыргыз Республикасынын Президентине караштуу Эл аралык стратегиялык изилдөөлөр институтунун директору болгон;
2002-жылдын февраль айында Кыргыз Республикасынын Президентинин Администрациясынын Коргоо жана коопсуздук иштери боюнча бөлүмүнүн Башчысына дайындалган;
2002–2005-жылдары – Кыргыз Республикасынын Башкы прокурору болуп иштеген.
2005-жылдын 25 мартында Кыргыз Республикасынын Ички иштер министринин милдетин аткаруучу болуп дайындалган;
2006-2007-жылдары – Кыргыз Республикасынын Президентинин Администрациясынын жетекчиси;
2010-2015-жылдары Кыргыз Республикасынын Жогорку Кеңешинин V чакырылыштагы  депутаты;
2010-2011-жылдары   Кыргыз Республикасынын Жогорку Кеңешинин Торагасынын орун басары, 2012-жылы Жогорку Кеңештин Мыйзамдуулук, укук тартиби жана кылмыштуулук менен күрѳшүү боюнча комитетинин тѳрагасы;
2012-2014-жылдары Жогорку Кеңештин «Ата-Журт» парламенттик фракциясынын лидери, ошол эле мезгилде парламенттеги азчылык коалициясынын лидери;
2015-жылы Кыргыз Республикасынын Жогорку Кеңешинин VI чакырылышынын  депутаты.
 
Кыргыз Республикасынын эмгек сиңирген юристи,   юридика илимдеринин кандидаты;
Мамлекеттик кызматтын I класстагы мамлекеттик кенешчиси, Юстициянын II класстагы мамлекеттик кенешчиси,    Милициянын генерал-лейтенанты;
Кыргыз Республикасынын  I  даражадагы «Күжүрмѳн кызмат ѳтѳгѳндүгү үчүн» медалы;
КМШ Парламенттер аралык Ассамблеясынын «Содружество» ордени;
Кыргыз Республикасынын  III даражадагы «Манас» ордени менен сыйланган.
 
Үй-бүлөлүү, эки баланын атасы.

