Өмүрбаяны
 1967-жылы 26-августта Ысык-Көл облусунун, Ысык-Көл районунун Темир айылында туулган.
Жогорку билимдүү.
1991-жылы Кыргыз Мамлекеттик Медициналык Институнун стоматология бөлүмүн аяктаган. Ал эми 1999-жылы Кыргыз Мамлекеттик Улуттук университетинин Экономика  адистиги боюнча билим алган.   
Эмгек жолун 1991-жылы Балыкчы шаарындагы стоматологиялык поликлиникасында тиш дарыгери болуп  иштеп баштаган;
2000-жылы жеке ишкердикке өтүп, "Чекиш Ата" ЖЧКсында директор болуп иштеген.
2008-жылы Аламүдүн райондук кеңешинин депутаты болуп шайланган, ошондой эле Архитектура, курулуш, коммуникация, орточо жана кичи бизнести өнүктүрүү боюнча комиссиясынын төрагасы болгон;
2010-жылы  Аламүдүн райондук кенешинин төрагасынын орун басары болуп иштеген;
2011-2012-жылдары Кыргыз Республикасынын Айлана чөйрөнү коргоо жана токой чарба мамлекеттик агенттигинин директорунун орун басары кызматында иштеген;
2012-2013 -жылдары Кыргыз Республикасынын Өкмөтүнө караштуу мамлекеттик материалдык резервдер Фондунун директору кызматында иштеген;
2013-2020-жылдары "Чекиш-Ата" ЖЧКсынын директору болуп иштеген;
2020-жылдан август айынан тарта Кыргыз Республикасынын Жогорку Кеңешинин  «Өнүгүү-Прогресс" фракциясынан депутат болуп шайланган;
Кошумча маалыматтар:
2008-жылы Кыргыз Республикасынын Экономикалык өнүктүрүү жана соода министрлигинин Ардак грамотасы менен сыйланган;
2009-жылы Кыргыз Республикасынын Ишкерлер союзунун Ардак грамотасы менен сыйланган.
Үй-бүлөлүү, 3 уулу бар.

