Кыргыз Республикасынын Ардак Грамотасы (2002-жыл)
Үй-бүлөлүү, алты  баланын атасы

Өмүрбаяны
 1960 – жылы 22—декабрда Нарын  облусунун Ат-Башы  районуна караштуу Кара-Суу  айылында туулган. Жогорку билимдүү. 1979-1981-жылдары Советтик армиянын катарында кызмат өтөгөн.
1987-жылы К.И.Скрябин атындагы Кыргыз улуттук агрардык университетинин «Айыл чарба механизация» факультетин бүтүргөн.
Иш тажрыйбасы:  
1978-1979      - Нарын облустук бириктирилген ооруканасында  “Электрик” кызматы;
1979-1981 – Советтик армиянын катарында кызмат;
1987-1988 – Фрунзе ондоо механикалык заводунда“Механик”;
1988-1990 – ОТК “ контролер-инженер”;
1990-1996 – Тянь-Шань МПМК-2 “ Башкы  механик”;
1996-1999 –“Хан-Тенгри Достук”  СПда “Эл аралык бөлүмдүн экспедитору”;
1999-2007 –“Адек” ЖЧК нун  жана “Камкор”  АКда “Башкы директор”;
2007-2009 - “Асман-ТСШ” ЖЧКсында “Башкы  директордун орун басары”;
2009 –  июнь 2020  – “Камкор” АКда “Директор”.
