 Билими:
1988-1993-Кыргыз мамлекеттик университети, эсептөө-экономикалык факультет, «экономика соодасы» адистиги;
1999-2000-Кыргызстандагы Эл аралык университет, юридика факультети, «юриспруденция» адистиги;
Иш тажрыйбасы:
1994-жылдын октябры – Жалал-Абад шаарындагы «Кыргызстан» АКБнын башкы дирекциясы, кредиттик саясаттын башкы адиси;
1998-жылдын июлу – баалуу кагаздар жана банк ресурсу боюнча бөлүмдүн башкы адиси;
1999-жылдын марты – «Акционердик Интернешнл Бизнес Банк», кардарлар менен иштөө адиси;
2000-жылдын июну – Жалал-Абад шаарындагы «Ысык-Көл» АКБ инвестициялык банкынын филиалынын кредиттик бөлүмдүн башчысынын орун басары;
2001-жылдын ноябры – «ЭкоБанк» «Эко-Жалал-Абад»  филиалынын башкаруучусу;
2008-жылдын августу – «ЭкоИсламикБанк» ААКнын башкармалыгынын мүчөсү, «Жалал-Абад» шаарындагы  филиалынын башчысы;
2011-жылдын январы – «ЭкоИсламикБанк» ААКнын башкармалыгынын түштүк бөлүмү боюнча орун басары;
2013-жылдын августу – башкармалыктын мүчөсү, «ЭкоИсламикБанк» ЖАКнын филиалынын башчысы;
2014-жыл – ЭкоИсламикБанк» «Жалал-Абад» ЖАКнын филиалынын башчысы.
