Өмүрбаяны
 Кыргыз Республикасынын Чүй облусунун Токмок шаарында 1966-жылдын 29-июлунда туулган.
Жогорку билимдүү: 1988-жылы Фрунзе шаарындагы К.И.Скрябин атындагы КАЧИнин агрономиялык факультетин бүтүргөн; 1992-жылы Ташкент шаарынан СССР МККнын Жогорку курсун (араб тилин билүү менен) аяктаган; 1994-жылы Москва шаарындагы Ю.Андропов атындагы СССР МККнын Кызыл туулуу институтун бүтүргөн.
Эмгек жолу:
- 1988-1990-жылдары Чүй районундагы С.Ибраимов атындагы ишканада агроном;
- 1990-1991-жылдары Кыргыз ССРинин ЛКЖБнын Чүй райкомунун комсомол уюмдарында иштеген;
-1991-2008-жылдары Кыргыз Республикасынын улуттук коопсуздук органдарынын чалгындоо жана контрчалгындоо бөлүмдөрүндө кызмат кылган;
- 2008-2011-жылдары Кыргыз Республикасынын МУККунда чалгындоо жетекчиси;
- 2011-2014-жылдары КР МУККунун Төрагасынын биринчи орун басары-Коррупцияга каршы кызматынан (АКС) директору;
- 2014-2015-жылдары КР МУККунун Казакстан Республикасындагы расмий өкүлү, Астана шаары;
- 2015-жылдан “Кыргызстан” саясий партиясынын саясий кеңешинин мүчөсү;
- 2019-жылдын сентябрынан “Кыргызстан” саясий партиясынан Кыргыз Республикасынын Жогорку Кеңешинин депутаты.
Кыргыз Республикасынын Жогорку Кеңешинин Эл аралык иштер, коргоо жана коопсуздук боюнча комитетинин мүчөсү.
Аскердик наамы – полковник.
Кыргыз Республикасынын улуттук коопсуздук органдарында кызмат өтөгөн мезгилдерде төмөнкүдөй мамлекеттик сыйлыктар ыйгарылган:
- “Даңк” медалы” (2006-ж.) – чалгындоо иштерине сиңирген эмгеги үчүн;
- “Эрдик” медалы (2013-ж.) – эрдиги жана чет өлкөлөрдө кызматтык милдеттерин аткаруудагы каармандыгы үчүн.
Үй –бүлөлүү, эки баланын атасы.

