Өмүрбаяны
 1973-жылы 27-апрелде Ош облусунун Ош шаарында жумушчун үй-бүлөсүндө туулган.
2001-жылы Ош технологиялык университетинин «Экономика» факультетин аяктаган.
Үй-бүлөлүү, 3 баланын атасы.
Эмгек ишмердүүлүгү:
1990-1991-жылдары "Кеңеш" совхозунун жумушчусу;
1991-1995-жылдары "Палван" кайрымдулук фондунда экспедитор;
2007-2015-жылдары Ош шаардык кеңешинин депутаты;
2009-2020 "Давлет БЖК" ЖЧКсынын директору;
2020-жылдын октябрь айында "Кыргызстан" саясий партиясынын тизмесине ылайык, VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты болуп шайланган.

