Өмүрбаяны
 1977-жылы 2-декабрда Кыргыз Республикасынын Жалал-Абад  облусунун   Базар-Коргон районунун Шыдыр айылында туулган.
Жогорку билимдүү. 1998-жылы Жалал-Абад Коммерциялык институтун экономика адистиги боюнча аяктаган.
Эмгек жолун 2005-жылы "Бажы инфраструктурасынын техникалык өнүгүү дирекциясынын" инспектору болуп баштаган;
2008 - 2015-жылдары "Шыдыр - авто транс" ЖЧКсынын директору;
2015 - 2020-жылдары "Симай-гида" ЖЧК коммерциялык директору;
2020-жылдын октябрь айынан тарта "Өнүгүү прогресс" партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты болуп шайланган;
Үй-бүлөлүү, беш баланын атасы.

