2017–2018 — И.Арабаев атындагы Кыргыз мамлекеттик университетинин аймактык жана маданий изилдөөлөр кафедрасынын окутуучусу;
2017 – 2018 — Кыргыз Республикасынын Президентине караштуу мамлекеттик тил боюнча улуттук комиссиясынын кыргыз тили боюнча тартылган окутуучсу;
2018 – 2019 — Кыргыз Республикасынын Жогорку Кеңешинин "Кыргызстан" фракциясынын сектор башчысы;
2019 -  "Кыргызстан" партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты.

Дополнительно:

2015–2017 — Өзгөчө кырдаалдар министрлигинин коомдук байкоочу кеңешинин мүчөсү;
2017–2018 — КТРКнын байкоочу кеңешинин мүчөсү.

Мамлекеттик кызматтын 1-класстагы мамлекеттик кеңешчиси.
Үй-бүлөлүк абалы: никеси бар.

Өмүрбаяны
 1978-жылы Ош облусуна караштуу Араван районунун Төө-Моюн айылында туулган.
Жогорку билимдүү. 2001-жылы Кыргыз-Өзбек университетинин “Финансы жана Кредит” факультетин аяктаган.
Эмгек жолун 2001-жылы жеке ишкер катары баштаган.
1996-2001-жылдары Ош облусундагы Кыргыз-Өзбек университетинин студентти;
2001-2008-жылдары жеке ишкер;
2008-2010-жылдары АК «Гаранттын» директору;
2010-2011-жылдары Кыргыз Республикасынын Жогорку Кеңешинин Төрагасынын жардамчысы болуп эмгектенген.
2011-жылы  24-июнунан тарта АК «Гаранттын» директору;
2011-жылдын 21-июлунан 23-сентябрына чейин Кыргыз Республикасынын Жогорку Кеңешинин Төрагасынын кеңешчиси болуп иштеген;
2011-2015-жылдары Кыргыз Республикасынын Жогорку Кеңешинин V-чакырылышынын депутаты;
2018-жылы 29-ноябрда ААК «Кыргызтелекомдун» төрагасынын кеңешчиси болуп дайындалган;
2018-жылдын 26-декабрынан бери Кыргыз Республикасынын Жогорку Кеңешинин VI-чакырылышынын депутаты.
Үй-бүлөлү, төрт баланын атасы.

