 1990-жылы 10 январда Чүй облусунун Сокулук районунун Военно-Антоновка айылында туулган.
Жогорку билимдүү. 2012-жылы  Ж. Баласагын атындагы Кыргыз улуттук университетин  «Статистика»  адистиги боюнча  аяктаган. Квалификациясы «Экономист».
 2013-ж. апрель - июнь - «РСК Банк» ААКнын сактык кассасынын кассири; болуп эмгектенген;
2013-ж. июнь -2014-ж. октябрь - «РСК Банк» ААКнын сактык кассасынын бухгалтери болуп иштеген;
2014-ж. октябрь - 2016-ж. март - «РСК Банк» ААКнын сактык кассасынын жетекчиси болуп дайындалган;
2016-ж. октябрь – 2016-ж. сентябрь – «РСК Банк» ААКнын сактык касса башкармалыгынын башкы адиси болуп иштеген;
2016-ж. сентябрь – 2018-ж. апрель – «РСК Банк» ААКнын Кызматкерлер менен иштешүү башкармалыгынын алдыңкы менеджери болуп эмгектенген;
2016-ж. апрель – 2018-ж. август – «РСК Банк» ААКнын Кызматкерлер менен иштешүү башкармалыгынын башкы менеджери болуп иштеген;
2018-ж. август – 2020-ж. апрель – «РСК Банк» ААКнын Маркетинг департаментинин башкы менеджери болуп дайындалган;
