Өмүрбаяны
 Ош областынын Араван районундагы Төө-Моюн айылында 1965-жылы 25-февралда туулган, улуту кыргыз.
1989-жылы Фрунзе политехникалык институтун  (ФПИ) “Инженер-куруучу” адистиги боюнча артыкчылык менен аяктаган.
2015-2018 жылы Кыргыз Улуттук Университетинин Юридикалык факультетин ийгиликтүү аяктаган.
1984-1986 жылдары Советтик Армиянын катарында кызмат өтөгөн.
Эмгек жолун 1989-жылы ФПИнин илимий чарбалык инженери болуп иштөө менен баштаган.
1990-1996 жылдары  ФПИнин кафедрасында окутуучу болуп эмгектенген.
1996-2000 жылдары “Имарат Сервис” ЖЧКсынын курулуш боюнча директору.
2000-2007 жылдары - “Промсталь” ЖЧКсынын башкы директору.
2007-2015 жылдын январына чейин “Строймир” ЖЧКсынын башкы директору.
2012-жылдан тартып “Ак-Каркыра” Тайцзи-цюань федерациясынын мүчөсү.
2015-жылдын январь айынан баштап Кыргызстан Социал-демократиялык партиясынын тизмеси боюнча V-чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаттыгына шайланган. Кыргыз Республикасынын Жогорку Кеңешинин транспорт, коммуникациялар, архитектура жана курулуш боюнча комитетинин мүчөсү болгон.
2015-жылы Кыргыз Республикасынын фехтования федерациясынын президенти болуп дайындалган.
2015-жылдан тартып “Саякбай манасчы” эл аралык фондунун президенти болуп “Манас” эпосун жайылтууда алгылыктуу иштерди жасап келет.
2015-жылы “Мамлекеттик кызматтын 3-класстагы мамлекеттик кеңешчи” деген класстык чен ыйгарылган.
2017-жылы Тайцзи-цюань федерациясынын вице-президенти болуп дайындалган.
2017-жылы 13-апрелинде Кыргыз Республикасынын Жогорку Кеңешинин Аппаратынын жетекчиси болуп дайындалган.
2020-жылдын апрелинен тартып Кыргызстан Социал-демократиялык партиясынын тизмеси боюнча VI-чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаттыгына шайланган. Кыргыз Республикасынын Жогорку Кеңешинин Укук тартиби, кылмыштуулук менен күрөшүү жана коррупцияга каршы аракеттенүү боюнча комитетинин мүчөсү.
 
Сыйлыктар:
2011-жылы Кыргыз Республиканын социалдык-экономикалык, интеллектуалдык жана руханий потенциалын өнүктүрүүгө кошкон салымы үчүн Кыргыз Республикасынын Ардак грамотасы менен сыйланган;
2011-жылы Апрел окуяларынан жапа чеккен түштүк регионунун тургундарына гуманитардык жардам көрсөтүүгө карата жарандык позициясы үчүн Кыргыз Республикасынын Жаштар иштери боюнча министрлигинин Ардак грамотасы менен сыйланган;
2012-жылы Өзгөчө кырдаалдарды жоюуга катышкандыгы үчүн Кыргыз Республикасынын Өзгөчө кырдаалдар министрлигинин Ардак грамотасы жана медалы менен сыйланган;
2014-жылы Кыргыз Республикасынын Өкмөтүнө караштуу Архитектура мамлекеттик агенттигинин, курулуш жана турак-жай коммуналдык чарбасынын Ардак грамотасы менен сыйланган;
2015-жылы Ысык-Көл облусунун Жети-Өгүз районунун “Ардактуу атуулу” наамын алган;
2016-жылы Ысык-Көл облусунун “Ардактуу атуулу” наамын алган;
2016-жылы Кыргыз Республикасынын Жогорку Кеңешинин Ардак грамотасы менен сыйланган;
2016-жылы Бишкек Шаардык Кеңешинин Ардак грамотасы менен сыйланган;
2016-жылы Кыргыз Республикасынын Билим берүүнүн мыкты кызматкери;
2016-жылы «XX  кылымдын “Саякбай”, “Суйламан-Тоо”, “Уламыштар” аттуу кино-тасмаларынын башкы продюсери;
 2017-жылы Кыргыз Республикасынын Өкмөтүнүн Нарын облусундагы ыйгарым укуктуу өкүлчүлүгүнүн Ардак Грамотасы менен сыйланган;
2017-жылы Ат-Башы районунун “Ардактуу атуулу” наамын алган;
2017-жылы Кыргыз Республикасынын Өкмөтүнүн Ардак Грамотасы менен сыйланган;
2017-жылы кино тармагынын мыкты кызматкери төш белгиси менен сыйланган;
2018-жылы Кыргыз Республикасынын “Даңк” медалы менен сыйланган;
2018-жылы Кыргыз Республикасынын Өкмотүнө караштуу Жаштар иштери, дене тарбия жана спорт  мамлекеттик агентигинен спорт “Отличниги” менен сыйланган;
2018-жылы Кыргыз Республикасынын Айыл чарба жана мелиорациянын министрлигинен Мыкты кызматкери төш белгиси менен сыйланган;
2018-жылы “Маданияттын мыкты кызматкери” төш белгиси менен сыйланган;
2019-жылы Кыргыз Республикасынын Өкмөтүнө караштуу Мамлекеттик миграция кызматынын “Шериктештик үчүн” төш белгиси менен сыйланган;
2019-жылы Кыргыз Республикасынын Маданият, маалымат жана туризм министрлигинин отличниги;
 2019-жылы Кыргыз Республикасынын Билим берүү министрлигинин отличниги;
2019-жылы Нарын областынын “Ардактуу атуулу” наамын алган;
2020-жылы Кыргыз Республикасынын Юстиция министрлигинин “Кызматташтык салымы үчүн” медалы менен сыйланган.
       
Үй-бүлөлүү,  үч баланын атасы.

