Өмүрбаяны
 1980-жылдын 1-августунда Кыргыз Республикасынын Чүй облусунун Чүй районундагы Токмок шаарында тѳрѳлгѳн;
Жогорку билимдүү. 2004-жылы Ишкердик жана укук Москва институтунун Бишкектеги филиалынын юридика факультетин бүтүргөн;
Эмгек жолун 1999-жылы “Эликсир-Экспресс” ЖЧКсында жумушчу болуп иштеп баштаган;
2001-2003-жылдары балдарды окутуу борбору “Мээрим” эл аралык кайрымдуулук фондунда, андан кийин Токмок-Мельзаводунда экономист, “Интергласс” ЖЧКсында коопсуздук инспектору болуп иштеген;
2004-2005-жылдары – Чүй облусуна караштуу ички иштер бөлүмүндө кызмат өтөгөн;
2005-2010-жылдары жеке ишкерлик менен алектенген;
2010-2012-жылдары Чүй облусуна караштуу ички иштер бөлүмүндө кызмат өтөгөн;
2012-2015-жылдары - “Хово Центр” ЖЧКнын аткаруучу директору;
2015-2018-жылдары - Чүй облусунун жана Бишкек шаарынын адвокаттар коллегиясында адвокаттын жардамчысы;
2013-жылдан баштап Чүй жана Кемин райондорунун, Токмок шаарынын бокс федерациясынын президенти;
2016-жылдан баштап “Барс - Токмок” кесиптик мушкердик клубунун президенти;
2016-жылы Токмок шаардык кеңешинин депутаты, социалдык маселелер боюнча комиссиянын төрагасы болуп шайланган;
2020-жылы Кыргыз Республикасынын Жогорку Кеңешинин VI-чакырылышынын  депутаты;
Үй-бүлөлүү, беш баланын атасы.

