Өмүрбаяны
 1968-жылы Ош облусуна караштуу Өзгөн районунун Ак-Жар айылында туулган. Жогорку билимдүү.
1991-жылы Кыргыз айыл-чарба институтунун зооинженер адистиги боюнча бүтүргөн. Айыл-чарба илимдеринин кандидаты.
 Эмгек жолу
1985-1986-жж. Өзгөн районундагы «Табак» чарбасында  туутту эсепке алуу боюнча техник;
1986-1996-жж. Студент, аспирант, Кыргыз айыл-чарба институтунун ассистенти;
1996-1998-жж. КРнын жергиликтүү өзүн өзү башкаруу органдары боюнча Ассоциациянын башкы адиси;
1998-1998-жж. КРнын жергиликтүү коомчулук Конгрессинин аппаратынын жетекчиси;
1998-1999-жж. КР Президенттик администрациясынын жергиликтүү өзүн өзү башкаруу жана агрардык саясат бөлүмүнүн башчысынын орун басары;
1999-2000-жж. КР Президенттик администрациясынын мамлекеттик башкаруу  жана уюштуруу иштери бөлүмүнүн агрардык саясат секторунун эксперти:
2000-2006-жж.  КР Президенттик администрациясынын  мамлекеттик башкаруу жана уюштуруу бөлүмүнүн мамлекеттик инспектору;
09.2006-10. 2006-жж. КР Президенттик администрациясынын мамлекеттик башкаруу жана уюштуруу иштери бөлүмүнүн башчысынын орун басары, мамлекеттик кызмат боюнча Кеңештин мүчөсү;
13.11.2007-2007-жж. КР Президенттик администрациянын мамлекеттик башкаруу жана уюштуруу иштери бөлүмүнүн башчысы;
11.2007-2009-жж. Ош облусунун губернатору;
10.2009-04.2010-жж. Өкмөттүн Аппарат жетекчиси, вице-премьер-министр;
07.2011-12.2011-жж. КР Өкмөт башчысынын кеңешчиси;
12.2011-12.2011-жж. КР Президенттик аппараттын кадрдык жана аймактык, мамлекеттик  башкаруу бөлүмүнүн башчысы;
2011-2012-жж. Биринчи вице-премьер-министр;
2012-2015-жж. КР Мамлекеттик кадр кызматынын директору;
2015-2016-жж. Биринчи вице-премьер-министр;
2016-2017-жж. КР Президенттик аппаратынын жетекчисинин биринчи орун басары.

