1988-1990-жылдары Өзгөндүн АТП “Агропромтранс” ишканасынын эксплуатация бөлүм башчысы;
1990-1991-жылдары Өзгөндүн АТП “Агпромтранс” ишканасынын башчысы;
1991-1994-жылдары МП “Транспортник” ишканасынын башчысынын орун басары;
1994-2001-жылдары АК “Залкар” башчысы;
2001-2010-жылдары Кыргыз Республикасынын Өкмөтүнө караштуу Мамлекеттик сатып алуулар жана материалдык резервдер боюнча мамлекеттик комиссиянын Ош облустук өкүлчүлүгүнүн башчысы;
2020-жылы Кыргыз Республикасынын Жогорку Кеңешинин VI-чакырылышынын  депутаты;
Үй бүлөлүү, төрт баланын атасы.

