Өмүрбаяны
 Керезбеков Канат Керезбекович
1970-жылдын 29-январында Нарын облусунун Жумгал районундагы Жумгал  айылында туулган.
Жогорку билимдүү. 1993-жылы Кыргыз мамлекеттик улуттук университетинин юридикалык факультетин, 1997-жылы Кыргыз мамлекеттик улуттук университетинин аспирантурасын, 2008-жылы Урал мамлекеттик юридикалык академиясынын докторантурасын бүтүргөн.
Эмгек жолун 1992-жылы “Элдос лтд” илимий-өндүрүштүк фирмасында юрисконсульт болуп иштөө менен баштаган.
1996-2005-жылдары Кыргыз Републикасынын Улуттук илимдер академиясынын философия жана укук  институтунун укук бөлүмүнүн кенже илимий кызматкери, илимий кызматкери, улук илимий кызматкери, бөлүмдүн башчысы болуп иштеген.
1998-2005-жылдары Кыргыз мамлекеттик улуттук университетинин юридикалык факультетинин жарандык укук жана процесс кафедрасынын окутуучусу, адистерди максаттуу даярдоо институтунун юридикалык факультетинин жарандык жана ишкердик укук кафедрасынын доценти, Эл аралык билим берүү программаларын интеграциялоо институтунун бажы жана юридикалык кадрларды кайра даярдоо факультетинин доценти, жарандык укук жана процесс кафедрасынын башчысы, директордун орун басары, директордун милдетин аткаруучу кызматын алып барган.
2005-2017-жылдары Кыргыз Республикасынын Өкмөтүнө караштуу Кыргыз мамлекеттик юридикалык академиясынын ректору болуп иштеген.
Коомдук ишмердүүлүгү:
2000-2005-жылдары Аз камсыз болгон жана   кембагал жарандар үчүн жарандык иштер боюнча акысыз юридикалык кеңештерди уюштуруучу «Евразия» фондунун колдоосу менен түзүлгөн «Жардам» долбоорунун автору жана жетекчиси;
2003-2004,2010-2013 жылдары Кыргыз Республикасынын Улуттук телерадиоберүү корпорациясынын байкоочу кеңешинин мүчөсү;
2006-2017 жылдары Медиа Өкүлчүлүк Институтунун байкоочу кеңештин мүчөсү;
2011-2017 жылдары Кыргыз Республикасынын Ректорлор Кеңешинин башчысынын орун басары;
2011-2013 жылдары Кыргыз Республикасынын Өкмөтүнө караштуу Кыргыз мамлекеттик юридикалык академиясынын юридикалык илимдеринин докторлук (кандидаттык) илимий даражасын изденип алуу үчүн диссертацияларды коргоо боюнча Д.12.11.033 Диссертациялык кеңештин төрагасы;
2012-жылдан азыркы кезге чейин Кыргыз Республикасынын Президентинин алдындагы сот реформасы боюнча Кеңешинин мүчөсү;
2012-2017 жылдары Кыргыз Республикасынын Билим берүү жана илим министрлигинин коллегиясынын мүчөсү;
2013-жылдан азыркы кезге чейин Кыргыз Республикасынын жогорку Аттестациялык Комиссиянын мүчөсү;
2011-2016  жылдары Кыргыз Республикасынын Өкмөтүнө караштуу Кыргыз мамлекеттик юридикалык академиясынын жана Кыргыз Республикасынын милициянын генерал-майору Э.Алиев атындагы ИИМ Академиясынын юридикалык илимдердин докторлук (кандидаттык) илимий даражасын изденип алуу үчүн диссертацияларды коргоо боюнча Д.12.14.490 Диссертациялык кеңештин төрагасы;
2015-2017  жылдары Кыргыз Республикасынын Премьер-министрине караштуу илим жана инновация боюнча Кеңештин мүчөсү;
2015-жылдан азыркы кезге чейин Кыргыз Республикасынын Президентине караштуу билим берүүнү жана илимди өнүктүрүү маселелери боюнча Коомдук эксперттик кеңештин мүчөсү;
2014- азыркы кезге чейин Кыргыз Республикасынын ЖОЖдор Ассоциациясынын Ардактуу Президенти;
2018- азыркы кезге чейин Кыргыз Республикасынан Венеция комиссиясындагы мүчөсү.
Кошумча маалымат:
1998-2005 жылдары Кыргыз улуттук университетинин доктордук (кандидаттык) диссертацияларды жактоо боюнча  Ведомстволор аралык диссертациялык Кеңештин  мүчөсү;
2000-2003 жылдары Кыргыз Республикасынын Бишкек шаарындагы Урал Мамлекеттик Юридикалык Академиясынын (Екатеринбург шаары, Россия Федерациясы) өкүлчүлүгүнүн директору;
2002-2006 жылдары Кыргыз Республикасынын  Юстиция министирлигинин алдындагы ченемдик-укуктук актыларын инвентаризациялоо боюнча ведомстволор аралык комиссиянын мүчөсү;
2002-2006 жылдары Кыргыз Республикасынын Юстиция Министирлигинин адвокаттык ишмердик менен алектенүүгө лицензия алуу боюнча квалификациялык комиссиянын мүчөсү;
2011-2012 жылдары Укуктук саясат концепцияларынын долбоорун иштеп чыгуучу жумушчу тобунун мүчөсү;
2011-жылдан азыркы кезге чейин Кыргыз Республикасынын Президентине караштуу мамлекет тарабынан кепилденген юридикалык жардам көрсөтүү боюнча Улуттук кеңештин мүчөсү;
2003-2006-жылдары ARD/Checci жана USAID коммерциялык укукту өнүктүрүү долбоору каржылаган “Укук жана ишкердүүлүк” журналынын редакциялык коллегиясынын мүчөсү.
2005-2006-жылдары Кыргыз Республикасынын Конституциясын даярдоо боюнча конституциялык кеңешменин мүчөсү;
2005-2006-жылдары Кыргыз Республикасынын Жогорку Сотунун жана Акыйкатчысынын алдындагы адам укугу боюнча Кеңешинин мүчөсү;
2008-жылдан азыркы кезге чейин Казахстан Республикасынын “Мыйзам жана мезгил” республикалык коомдук-саясий, илимий-укуктук журналынын редакциялык коллегиясынын мүчөсү;
2010-жылы Кыргыз Республикасынын Конституциясын даярдоо боюнча конституциялык кеңешменин мүчөсү;
100дөн ашык илимий эмгектердин автору.
Анын илимий жетекчилиги астында юридика илимдеринин 40 кандидаты, 6 юридика илимдеринин докторлору диссертацияларын коргогон.
«Кыргыз Республикасынын Жер укугу», «Бейтарап сот», «Укуктаануу» окуу китептерин жазуу боюнча автордук коллективин жетектеген;
«Кыргыз Республикасындагы массалык маалымат каражаттары жана укук» окуу китебинин авторлошу;
Кыргыз Республикасынын Эмгек сиңирген юристи.
Юридика илимдеринин доктору, профессор.
2004-жылы Кыргыз Республикасынын Президентинин Жарлыгы менен «ДАҢК» медалы ыйгарылган.
2007-жылы Кыргыз Республикасынын Юстиция министринин буйругу менен Юстициянын отличниги төш белгиси менен сыйланган.
2009-жылы Кыргыз Республикасынын Билим берүү министринин буйругу менен Билим берүүнүн отличниги төш белгиси менен сыйланган.

