Өмүрбаяны
 1981-жылы 24-мартта Бишкек шаарында туулган.
Жогорку билимдүү.
2002-жылы «Автоматташтыруу жана башкаруу» адистиги боюнча И.Раззаков атындагы Кыргыз техникалык университетинин Маалыматтык технологиялар факультетин аяктаган – бакалавр даражасы.
2003-жылы «Автоматташтыруу жана техникалык системаларды башкаруу» адистиги боюнча И.Раззаков атындагы Кыргыз техникалык университетинин Маалыматтык технологиялар факультетин аяктаган – жогорку билим (магистратура).
2011-жылы «Финанс жана кредит» адистиги боюнча Кыргыз экономикалык университетин бүтүргөн.
Иш тажрыйбасы:
2003-2004 жж. – КР Социалдык фонду, программалык камсыз кылуу бөлүмүнүн жетектөөчү адиси;
2004-жылдын март айынан ноябрь айына чейин - КР Социалдык фонду, программалык камсыз кылуу бөлүмүнүн башкы адиси;
2004-2006 жж. - КР Социалдык фонду, программалык камсыз кылуу бөлүмүнүн жетекчиси, башкармалыгынын жетекчиси;
2006-жылдын апрель айынан декабрь айына чейин - КР Социалдык фонду, Маалыматтык системалар башкармалыгынын жетекчиси;
2006-2008 жж. - КР Экономика жана финансы министрлиги, маалыматтык камсыздоо бөлүмүнүн башчысы;
2008-жылдын май айынан декабрь айына чейин – КР Финансы министрлиги, министрдин жардамчысы;
2007-2008 жж. – КР Экономикалык өнүктүрүү жана соода министрлиги, министрдин жардамчысы;
2008-2009 жж. – КР Экономикалык өнүктүрүү жана соода министрлиги, министрдин кеңешчиси;
2009-жылдын март айынан ноябрь айына чейин - КР Экономикалык өнүктүрүү жана соода министрлиги, Уюштуруу-кадр иштери жана финансылык камсыз кылуу башкы башкармалыгынын жетекчиси;
2009-2010 жж. – КР Өкмөттүн Аппараты, Биринчи вице-премьер-министринин кеңешчиси;
2010-жылдын август айынан ноябрь айына чейин - «Ар-Намыс» Саясий партиясы, Аппарат жетекчиси;
2010-2011 жж. – КР Жогорку Кеңеши, «Ар-Намыс» депутаттык фракциясынын бөлүм башчысы;
2011-2012 жж. – КР Экономикалык жөнгө салуу министрлиги, статс-катчысынын милдетин аткаруучу;
2012-жылдын январь айынан сентябрь айына чейин – КР Өкмөттүн Аппараты, реалдуу сектор бөлүмүнүн башчысы;
2013-2016 жж. – «СУ-12» ЖАК, Башкармалыгынын Төрагасы;
2016-2018 жж. – «Аллор Строй Сервис» ЖАК, Башкы мүдүрү;
2018-жылдын 13-мартынан тартып - Кыргыз Республикасынын Жогорку Кеңешинин VI чакырылышынын «Республика – Ата Журт» саясий партиясынын депутаты.
 
Сыйлыктары:
- «Социалдык кызматкеринин отличниги»;
- «Финансылык-экономикалык кызматкеринин  отличниги»;
- «Соода-экономикалык кызматкеринин отличниги»;
- Кыргыз Республикасынын Премьер-министринин атынан ысымы жазылган саат менен сыйланган;
- Кыргыз Республикасынын Өкмөтүнүн Ардак грамотасы.
Самбо боюнча спорт чеберлигине талапкер.
