- «Социалдык кызматкеринин отличниги»;
- «Финансылык-экономикалык кызматкеринин  отличниги»;
- «Соода-экономикалык кызматкеринин отличниги»;
- Кыргыз Республикасынын Премьер-министринин атынан ысымы жазылган саат менен сыйланган;
- Кыргыз Республикасынын Өкмөтүнүн Ардак грамотасы.
