Өмүрбаяны
 1975-жылдын 2-апрелинде Ош областынын Араван районунун А.Юсупов айылында туулган.
Жогорку билимдүү. 1997-жылы Кыргыз Республикасынын ИИМнин Бишкек жогорку милиция мектебин “юриспруденция” адистиги боюнча бүтүргөн. (азыркы КР ИИМинин генерал-майор Э.Алиев атындагы академиясы)
Эмгек жолун 1997-жылы Өзгөн районунун ИИБсында аймактык инспектор  болуп иштөө менен баштаган.
2000-2001-жылдары Араван райондук ИИБнын аймактык инспектору;
2001-2006-жылдары Араван райондук ИИБнын тергөөчүсү;
2007-2010-жылдары Араван ИИБнын айылдык милиция бөлүмчөсүнүн жетекчиси;
2011-жылы Бишкек шаарынын октябрь райондук ИИБнын баңги заттарга каршы күрөшүү бөлүмүнүн оперативдик кызматкери;
2011-2012-жылдары Бишкек шаарынын ИИББнын баңги заттарга каршы күрөшүү башкармалыгынын ага оперативдик кызматкери;
2012-2015-жылыдары Ноокат районунун ИИБнын жетекчисинин орун басары;
2015-жылдын март айынын август айына чейин Араван райондук ИИБнын жетекчисинин орун басары.
2015-жылдын 4-октябрында Кыргызстан социал-демократиялык партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаттыгына шайланган.
Үй-бүлөлүү, төрт баланын атасы.
Милициянын майору.

