 Туулган күнү: 1962 -жыл 20-ноябрь;
Улуту: кыргыз, үй-бүлөлүү, төрт балалуу;
Билими: жогорку, 1986 – 1991-жылы Кыргыз мамлекеттик университетин аяктаган (Факультет: Экономика, адистиги: Өнөр жайды пландаштыруу);
1980 – 1985 - жылдары Фрунзе курулуш техникумунун филиалын аяктаган;
