1991 – 2020-жылдары жеке ишкер;
1989- 1991-жылдары Ысык-Көл облсовпроф. (кызматы: инструктор);
1985-1989 –жылдары "Оргтехника" Миңкуш заводу (Кыргыз өндүрүш бирикмеси "Оргтехника" деп аталып калган, кызматы: жөндөөчүнүн шакирти – мастер);
1985 –жылы СПТУ № 22 Рыбачье (кызматы: мастер)
1985-1989-жылдары Советтик Армиянын катарында кызмат өтөгөн;
Тилдерди билүү  деңгээли: кыргыз (эне тили), орус (оозеки жана жазуу) .

