Өмүрбаяны
 1957-жылдын 12-мартында Чүй облусунун Аламүдүн районунун Горная Маевка айылында туулган.
Жогорку билимдүү. 1980-жылы Фрунзе политехникалык институтун инженер-механик адистиги боюнча бүтүргөн. 1989-1990-жылдары Алма-Атадагы (Казакстан) Жогорку партиялык мектепте угуучусу болгон.
Эмгек жолун 1976-жылы Кыргыз ССРинин Илимдер академиясында лаборант болуп иштөө менен баштаган.
1978-1980-жылдары Фрунзе шаардык транспорттук агенттикте диспетчер болуп иштеген.
1980-1981-жылдары Комсомолдун Кант райкомунда инструктордун милдетин аткаруучу кызматын аткарган.
1981-1984-жылдары Фрунзе шаарындагы №3 автопаркта автоколоннанын башчысы болгон.
1984-1986-жылдары ЛКЖБ БКда инструктор;
1986-1989- жылдары Партиянын Фрунзе шаарындагы Свердлов райкомунда инструктор;
1991-1994-жылдары КР Вице-президентинин, Биринчи вице-премьер-министринин жардамчысы;
1994-1998-жылдары КР Башкы транспорттук инспектору;
1998-2005-жылдары КР Темир жол башкармалыгынын башчысы;
1995-2007-жылдары I,II,III чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты.
2007-2010-жылдары Кыргызстан социал-демократтар партиясынын (КСДП) тизмеси боюнча IV чакырылыштагы КР Жогорку Кеңешинин депутаты болуп шайланган. 2008-жылдан Бириккен эл кыймылынын (БЭК) саясий бюросунун мүчөсү.
2010-жылдын апрелинен 2011-жылдын февралына чейин Бишкек шаарынын мэринин убактылуу милдетин аткаруучу;
2011-жылдын февралынан 2013-жылдын 5-декабрына чейин Бишкек шаарынын мэри;
2015-жылдын 4-октябрында Кыргызстан социал-демократтар партиясынын (КСДП) тизмеси боюнча VI чакырылыштагы КР Жогорку Кеңешинин депутаты болуп шайланган. Жогорку Кеңештин Транспорт, коммуникациялар, архитектура жана курулуш боюнча комитетинин төрагасы.
2016-жылдын апрелинен тарта СДПК парламенттик фракциясынын лидери
Үй-бүлөлүү, үч баласы бар.
II класстагы мамлекеттик кеңешчи.
“Ардактуу темир жолчу” ведомстволук белгиси менен сыйланган.
2011-жылдын 1-декабрында КР Президентинин Жарлыгы менен “Коррупциялашкан, элге каршы режимди кулатууда 2010-жылдын 6-7-апрелиндеги окуяларда өзгөчө эмгек сиңиргендигин таануу белгисинде” “Апрель элдик революциясынын баатыры” атайын төш белгиси менен сыйланган

