Өмүрбаяны
 1960-жылы 19-декабрда Талас облусунун Үрмарал айылында төрөлгөн
Билими:
1982 — Кыргыз мамлекеттик дене тарбия институтун аяктаган
1996 — Кыргыз мамлекеттик улутттук университетинен "укук таануучу" адистиги боюнча билим алган
 
Эмгек жолу:
1985-1995 — ИИМдин эмгек-түзөтүү мекемеси башкармалыгында инженер;
1995-1996 — Чүй облустук Аламүдүн РИИБдин "Беркут" отрядынын командири;
1996-2000 — КР ИИМдин Кылмышкерди издөө башкармалыгында ага кызматкер;
2000-2002 — КР ИИМдин оор кылмыш иштери менен күрөшүү башкармалыгында оор кылмыштардын бетин ачуу бөлүмүндө жетекчи;
2002-2004 — КР ИИМдин уюшкан кылмыштуулукка каршы күрөшүү бөлүмүнүн жетекчиси;
2004-2005 — Жалал-Абад ОИИББ жетекчисинин орун басары;
2005-2008 — КР ИИМдин кылмышкерди издөө башкы башкармалыгынын жетекчи орун басары
2008 — КР ИИМдин баңгизаттарга каршы күрөшүү башкы башкармалыгынын жетекчиси;
2008-2009 — КР ИИМдин уюшкан кылмыштуулукка каршы күрөшүү башкармалыгынын жетекчиси;
2009-2010 — ИИМдин 9-башкармалыгынын жетекчиси, Бишкектин Свердлов райондук ИИБлин башчысы;
2010-жылдын майында Бишкек ШИИБдин жетекчиси болуп дайындалып, андан кийин 2012-жылга чейин ички иштер министри болуп иштеген;
2012-2013 — КР Жаза аткаруу мамлекеттик кызматын жетектеген.
2017-жылдын 4-октябрында "Республика — Ата-Журт" фракциясынын тизмеси менен Жогорку Кеңешке депутат болуп келди.

