Өмүрбаяны
 1970-жылы 23-июндаа Кыргыз Республикасынын Ош облусунун Кара-Суу районундагы  Кашкар-Кыштак айылында тѳрѳлгѳн.
Жогорку билимдүү. 1996-жылы Ош технологиялык университетинин экономика факультетин бүтүргөн.
 
Эмгек жолу:
1991-1996 -жылдары  - Ош Техноогиялык университетинин студенти;
1995-1998 -жылдары  - экспедитор, эл аралык бизнес компания «Айренген ЛТД»;
1998-2001-жылдары  - сатуу бөлүмүнүн башчысы, ОАО “Араванский хлопкозавод Ак-Була”;
2001-2004-жылдары  - директордун орун басары, ОАО “Араванский хлопкозавод Ак-Була”;
2004-2006 -жылдары - директор  ОсОО “Рич-мен”;
2006-2009-жылдары -  төрага, “Жер-Эне” дыйкан чарбалырынын бирикмеси;
2009-2015 -жылдары – төрага, “Араван-Береке” дыйкан чарбалырынын бирикмеси;
2015-2019 -жылдары  – жеке ишкер;
2019-2020 г-жылдары – директор, «Береке» курулуш компаниясы.
