Өмүрбаяны
 1952-жылдын 18-февралында Чүй облусунун Жайыл районундагы Кызыл-Октябрь айылында туулган.
Жогорку билимдүү. 1979-жылы Кыргыз мамлекеттикуниверситетинин юридика факультетин аяктаган.
Эмгек жолун 1970-жылы №2903-автоколоннанын айдоочусу болуп баштаган.
1970–1972-жж. Советтик Армиянын катарында кызмат өтөгөн.
1973–1974-жылдары Кыргыз Республикасынын Ички иштер министрлигинин мамлекеттик автоинспекциясынын бөлүмүнүн жол көзөмөлдөөчү инспектору;
1974–1980-жылдары Кыргыз Республикасынын Ички иштер министрлигин мамлекеттик автоинспекциясынын бөлүмүнүн жол көзөмөлдөөчү ага инспектору;
1980–1983-жылдары Калинин райондук (азыркы Жайыл району) ички иштер бөлүмүнүн мамлекеттик автоинспекциясынын райондор аралык каттоо-сынак бөлүмүнүн мамлекеттик автоинспектору;
1983–1985-жылдары Калинин райондук(азыркы Жайыл району) ички иштер бөлүмүнүн тергөөчүсү;
1985–1986-жылдары Москва райондук  ички иштер бөлүмүнүн социалисттик мүлктү уурдоо менен күрөшүү боюнча бөлүмүнүн (ОБХСС ОВД) ыкчам-ыйгарымдуу, ага ыкчам-ыйгарымдуу кызматкери;
1986–1988-жылдары Кара-Балта шаардык ички иштер бөлүмүнүн социалисттик мүлктү уурдоо менен күрөшүү боюнча бөлүмүнүн (ОБХСС ОВД)  башчысы;
1988–1990-жылдары Калинин райондук (азыркы Жайыл району) ички иштер бөлүмүнүн башчысынын орун басары;
1990–1992-жылдары  Кара-Балта шаардык ички иштер бөлүмүнүн башчысы;
1992–1994-жылдары  Калинин районунун (азыркы Жайыл району) ички иштер бөлүмүнүн башчысы;
1994–1996-жылдары Ош областык ички иштер башкармалыгынын башчысы;
1996–2001-жылдарыЧуй областык ички иштер башкармалыгынын башчысы;
2001-жылдын март-октябрь айларында КР Ички иштер министрлигинин уюшкан кылмыштуулук менен күрөшүү боюнча башкы башкармалыгынын башчысы;
2001-жылдын октябрынан 2002-жылдын июнуна чейин  КР Ички иштер министрлигинин кылмышкерлерди издөө башкы башкармалыгынын башчысы;
2002 – 2005-жылдары Кыргыз Республикасынын Ички иштер министри;
2005-жылдын мартынан 2011-жылдын ноябрына чейин КР Ички иштер министрлигинин кадр резервинде, (айкалыштыруу боюнча) коомдук коопсуздук маселелер боюнча Кыргыз Республикасынын Президентинин Кеңешчиси;
2013-жылдын апрель айынан 2015-жылдын апрель айына чейин «Манас» эл аралык аэропорту» АКсынын директорлор кеңешинин төрагасы;
2016-жылдын 10-февралында “Бир бол” саясый партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты болуп шайланды. 2018-жылдын 16-апрелинде "Бир Бол" паламенттик фракциясынын лидеринин орун басары болуп шайланды.
Үй-бүлөлүү. Төрт баланын атасы.
