Өмүрбаяны
 1976-жылы 16-декабрда Жалал-Абад облусунун Сузак районунун Сузак айылында туулган.
Жогорку билимдүү.
1993 – жылы Талас областынын  Бакай-Ата районундагы   Чалдавар интернат мектебин бүтүргөн;
1997 – жылы Кыргыз агрардык академиясынын «Агробизнес» факультетин аяктаган;
2012 – жылы Ж.Баласагын атындагы Кыргыз улуттук университетинин юридикалык институтун аяктаган.
Эмгек жолу:
Жогорку окуу жайын аяктагандан кийин айыл чарба тармагында  жеке ишмердүүлүк менен алектенип келген;
2002 – 2010 - жылдары   «Нур» дыйкан чарбасынын жетекчиси;
2010 – 2014 - жылдары  Кыргыз Республикасынын ички иштер органында кызмат өтөгөн;
2014 – 2020 годы  - жылдары   «Нур» дыйкан чарбасынын төрагасы; 
2015 - жылы «Өнүгүү-Прогресс» саясий партиясынан Кыргыз Республикасынын Жогорку Кеңешинин депутаттыгына талапкер;
2020 - жылдын сентябр айынан тартып Кыргыз Республикасынын  «Өнүгүү-Прогресс» парламенттик фракциясынын депутаты.
Сыйлыктары:
Кыргыз Республикасынын Өкмөтүнүн Ардак грамотасы; 
Кыргыз Республикасынын Айыл, суу чарба жана кайра иштетүү өнөр жай министрлигинин   Ардак грамотасы;
Кыргыз Республикасынын Ички иштер министрлигинин Ардак грамотасы;
Кыргыз Республикасынын Социалдык фондунун Ардак грамотасы;
Талас облустук мамлекеттик администрациясынын жана Эл депутаттарынын облустук Кеңешинин Ардак грамотасы жана башка  бир топ айылдык, райондук денгээлдеги сыйлыктар;
Милициянын улук лейтенанты.   
Уй-бүлөлү, 4 баланын атасы.
Тилдерди билүүсү:
Кыргыз, орус, түрк тилдери.

