Өмүрбаяны
 Туулган күнү:   1953-жылдын  6-февралында Чүй облусунун Панфилов районундагы Кайыңды айылында туулган.
Жогорку билимдүү: 1981 - Фрунзе политехникалык институтунун технология факультети.
Эмгек жолу:
1972-1975           Советтик Армиянын катарында Кара деңиз флотунда кызмат өтөгөн;
1976                    Кайынды кант заводунда жумушчу;
1981-1987           Кайынды эт комбинатында технолог, МЖКнын жетекчиси, башкы инженер;
1987-1991           Кыргызстан компартиясынын борбордук комитетинде инструктор болуп эмгектенген;
1991                    Малды бордоп семиртип жана кайра иштетүүчү «Тунгуч» ассоциациясынын башкы директору;
1992-1993           Чүй облустук тамак-аш жана кайра иштетүү өнөр жай ассоциациясынын башкы директору, башкармалыктын башчысы;
1993-1997           "Кыргыз Тамак-Аш" концернинин эт комбинаты заводунун башкы директору;
1998-2002           ААК «Бишкек эт-консерва комбинатынын» башкы директору;
2002-2004           “Кыргызалко” мамлекеттик акционердик коомунун башкы директору, ошол эле учурда “Алкопром” мамлекеттик ишканасынын башкы директору;
2005-2007           Кыргыз Республикасынын Жогорку Кеңешинин тармактардын экономикасын өнүктүрүү, ишкердик жана жаратылыш ресурстарын пайдалануу боюнча комитетинин Төрагасы;
2008-2010           Жайыл райондук Мамлекеттик администрациянын башчысы;
12.10–12.11        Кыргыз Республикасынын Жаратылыш ресурстары министри;
08.13-06.20         ААК «Бишкек эт-консерва комбинатынын» директорлор кеңешинин мүчөсү, коммерциялык директору;
2020-жылдын июнь айынан тартып, бүгүнкү күнгө чейин Кыргыз Республикасынын Жогорку Кеңешинин Депутаты, отун-энергетикалык комплекс жана жер казынасын пайдалануу боюнча комитетинин мүчөсү.
Үй-бүлөлүк абалы:   Үй бүлөлүү, үч баланын атасы.
Кошумча маалымат:
2001 - Кыргыз Республикасынын өнөр жайына эмгек сиңирген ишмери;
«Даңк» медалы менен сыйланган;
2-класстагы мамлекеттик кеңешчи.

